import React from 'react';
import { 
  Box, 
  Paper, 
  Typography, 
  Grid, 
  Card, 
  CardContent,
  Chip,
  Divider
} from '@mui/material';

function ResponseDisplay({ response }) {
  if (!response || !response.conversation) return null;

  // Extracting final_recommendations (from ResidentialAgent ideally)
  const mikeMessage = response.conversation.find(item =>
    item.agent && item.agent.includes('Mike')
  );

  const finalProperties = mikeMessage?.message?.final_recommendations?.properties ?? [];

  return (
    <Box sx={{ mb: 2 }}>
      <Paper elevation={3} sx={{ p: 2 }}>
        <Grid container spacing={3}>

          {/* Properties Section */}
          {finalProperties.length > 0 && (
            <Grid item xs={12} md={6}>
              <Typography variant="h6" gutterBottom>
                Available Properties
              </Typography>
              <Grid container spacing={2}>
                {finalProperties.map((property, index) => (
                  <Grid item xs={12} key={index}>
                    <Card className="property-card">
                      <CardContent>
                        <Typography variant="subtitle1">{property.name}</Typography>
                        <Typography variant="body2">{property.price}</Typography>
                        <Typography variant="body2" sx={{ mb: 1 }}>
                          {property.highlight}
                        </Typography>
                        {property.features?.map((feature, idx) => (
                          <Chip 
                            key={idx}
                            label={feature}
                            size="small"
                            sx={{ mr: 1, mb: 1 }}
                          />
                        ))}
                      </CardContent>
                    </Card>
                  </Grid>
                ))}
              </Grid>
            </Grid>
          )}

        </Grid>
      </Paper>
    </Box>
  );
}

export default ResponseDisplay;
